for(var i = 0; i < records.length; i++) {
  try { 
    for (var k in records[i].value) {
      if (k == 'id' || k == 'type') {
      	continue
      }   
      var newMap = sdcFunctions.createMap(true);

      newMap['value'] = records[i].value[k];

      if (k == 'location')
        newMap['type'] = 'geo:json';
      else if (k.startsWith('date'))
        newMap['type'] = 'DateTime';
      else if (k == 'address')
        newMap['type'] = 'PostalAddress';
      else if (k.startsWith('ref'))
        newMap['type'] = 'Relationship';
      else if (k.startsWith('has'))
        newMap['type'] = 'Relationship';
      else if (typeof newMap['value'] == 'boolean' )
        newMap['type'] = 'Boolean';
      else if (typeof newMap['value'] == 'number' )
        newMap['type'] = 'Number';
      else if (typeof newMap['value'] == 'object' )
        newMap['type'] = 'StructuredValue';
      else newMap['type'] = 'Text';
        records[i].value[k] = newMap;
    }

    //update records for batch format
    var newRecord = sdcFunctions.createRecord(records[i].sourceId + ':newRecordId');
    newRecord.value  = {'actionType' : 'append', 'entities' : [ records[i].value ] };
    // Write record to processor output
    output.write(newRecord);
  } catch (e) {
    // Send record to error
    error.write(records[i], e);
  }
}
